Before we can explore population structure, we need to convert the file format so our packages can run the dataset.


Code
meta &lt;- read.table("data/metadata_samples.txt", header = TRUE, sep = "\t", stringsAsFactors = FALSE)
vcf_filt_SEA &lt;- readRDS("derived/vcf_filt_SEA.rds")

gl_SEA &lt;- vcfR2genlight(vcf_filt_SEA)

# Make sure the order of samples in meta matches genlight individuals
meta_ord &lt;- meta[match(indNames(gl_SEA), meta$sample), ]
saveRDS(meta_ord, file = "derived/meta_ord.rds")

stopifnot(all(meta_ord$sample == indNames(gl_SEA)))

# Assign populations by country
pop(gl_SEA) &lt;- meta_ord$country

gl_SEA


 /// GENLIGHT OBJECT /////////

 // 90 genotypes,  191 binary SNPs, size: 166.6 Kb
 1620 (9.42 %) missing data

 // Basic content
   @gen: list of 90 SNPbin

 // Optional content
   @ind.names:  90 individual labels
   @loc.names:  191 locus labels
   @chromosome: factor storing chromosomes of the SNPs
   @position: integer storing positions of the SNPs
   @pop: population of each individual (group size range: 30-30)
   @other: a list containing: elements without names 


Code
# optional save
saveRDS(gl_SEA, file = "derived/gl_SEA.rds")

